import React, { useEffect } from 'react';
import M from 'materialize-css';

export default function Home({ handleChange, handleSearch, cityName }) {
  // Initialize Materialize CSS components on component load
  useEffect(() => {
    M.AutoInit();
  }, []);

  return (
    <div className="container">
      {/* Header Section */}
      <div className="row">
        <div className="col s12">
          <h1 className="header">Welcome to Travel Bug</h1>
          <p className="subheader">Your Next Adventure Awaits</p>
        </div>
      </div>

      {/* Search Section */}
      <div className="row">
        <div className="input-field col s12">
          <input
            id="cityName"
            type="text"
            className="validate"
            value={cityName}
            name="cityName"
            onChange={handleChange}
          />
          <label htmlFor="cityName">Enter Your Destination</label>
        </div>
      </div>

      {/* Search Button */}
      <div className="row">
        <div className="col s12">
          <button
            className="btn waves-effect waves-light"
            type="submit"
            name="action"
            onClick={handleSearch}
          >
            Search
            <i className="material-icons right">search</i> {/* Icon for the search button */}
          </button>
        </div>
      </div>

      {/* Image Carousel Section */}
      <div className="carousel">
        <a className="carousel-item" href="#one!">
          <img src="https://lorempixel.com/250/250/nature/1" alt="Nature 1" />
        </a>
        <a className="carousel-item" href="#two!">
          <img src="https://lorempixel.com/250/250/nature/2" alt="Nature 2" />
        </a>
        <a className="carousel-item" href="#three!">
          <img src="https://lorempixel.com/250/250/nature/3" alt="Nature 3" />
        </a>
        <a className="carousel-item" href="#four!">
          <img src="https://lorempixel.com/250/250/nature/4" alt="Nature 4" />
        </a>
        <a className="carousel-item" href="#five!">
          <img src="https://lorempixel.com/250/250/nature/5" alt="Nature 5" />
        </a>
      </div>
    </div>
  );
}
